import (
	context "context"
	fern "github.com/validation/fern"
	fernclient "github.com/validation/fern/client"
)

client := fernclient.NewClient()
response, err := client.Get(
	context.TODO(),
	&fern.GetRequest{
		Decimal: 2.2,
		Even:    100,
		Name:    "foo",
	},
)

